const Login = () => {
    return (
        <div className="login">
            <div>
                <h2>Login</h2>
                <form>
                    <input className="input" id="username"></input>
                    <input className="input" id="password"></input>
                </form>
            </div>
        </div>
    )
};

export default Login;
